async function generarPDFAvanzado(url, outputPath) {
    const browser = await puppeteer.launch({
        headless: true,
        args: ['--no-sandbox', '--disable-setuid-sandbox']
    });

    const page = await browser.newPage();
    try {
        // Configurar viewport
        await page.setViewport({ width: 1200, height: 800 });

        // Navegar a la página
        console.log('Navegando a la URL:', url);
        await page.goto(url, {
            waitUntil: 'networkidle0',
        });
        console.log('Cargada a la URL:');
        // Esperar a que ciertos elementos carguen (opcional)
        await page.waitForSelector('body', { timeout: 20000 }).catch(() => {
            console.log('El selector finreporte no se encontró, continuando...')
        });

        console.log('Página cargada completamente');
        // Opciones avanzadas para el PDF
        const pdfOptions = {
            path: outputPath,
            format: 'LETTER',
            printBackground: true,
            displayHeaderFooter: true,
            headerTemplate: `
                <table style="width: 100%; font-size: 20px; border-bottom: 1px solid #ddd; "> 
                    <tr>
                        <td style="width: 20%; text-align: left;">
                            <img 
                            src="data:image/png;base64,"
                             alt="logo-ipn" style="height: 60px;">
                        </td>
                        <td style="width: 60%; text-align: center; font-weight: bold;">
                            Instituto Politécnico Nacional<br>
                            Dirección de Educación Superior<br>
                            Relacion de cuentas bancarias<br>
                        </td>
                        <td style="width: 20%; text-align: right;">
                            <img 
                            src="data:image/jpeg;base64," 
                            alt="logo-DES" style="height: 60px;">
                        </td>
                    </tr>
                </table>
            `,
            footerTemplate: `
                <div style="font-size: 10px; text-align: left; width: 100%;">
                    Generado el ${new Date().toLocaleDateString()}
                </div>
                <div style="font-size: 10px; text-align: right; width: 100%;">
                    Página <span class="pageNumber"></span> de <span class="totalPages"></span>
                </div>
            `,
            margin: {
                top: '65mm',
                right: '15mm',
                bottom: '15mm',
                left: '15mm'
            },
            preferCSSPageSize: true
        };

        // Generar PDF
        const pdfBuffer = await page.pdf(pdfOptions);

        console.log('PDF generado exitosamente');

        return pdfBuffer;

    } catch (error) {
        console.error('Error al generar PDF:', error);
        throw error;
    } finally {
        await browser.close();
    }
}

//prefijo
app.use('/cuentas', router);

